import React, { 
  Component,  
} 
from 'react';

import {
  Column,
  Grid,
  Row
} 
from "./components/bootstrap/grid";

import {
  CssClasses
} 
from "./utilities";

class App extends Component {
  render() {

    const classes = new CssClasses("abra", "ibra");

    classes.addClass("asma");

    console.log(classes);

    return (
      <div className="container-fluid bg-danger">
        <Grid>
            <Row>
              <Column>
                <h1 className="text-center"> abra </h1>
              </Column>
              <Column>
                <h1 className="text-center"> ibra </h1>
              </Column>
            </Row>
          </Grid>
      </div>
    );
  }
}

export default App;
